Description:
This is one of my first Music Videos, so I hope it satisfys you =3

// 2011 - 

Dear god, this is so old and brings back great memories. XD There's so many comments and stuff and I would feel random to reply to them all like... a year + later, so thank you very much for all the compliments and likes and whatnot. :D I appreciate it!

Austin band COTTON MATHER with a stunning video featuring an equally stunning model, Alicia Corbett.
from "Dan" :
I heard of this Texas group from Noel Gallagher who mentioned them in some interview. So out of curiousity i checked them out. When I finally heard them I understood why Noel liked them, Cotton Mather is even more Beatle-ish than Oasis (if you consider Oasis beatle-ish). Now for there music. The lead singer does a near perfect John Lennon impression on alot of the songs. To witness this listen to there other album Kon Tiki on the song "Home Cameo" you can barely tell the difference, and i've been listening to Lennon for years, so I kid you not. Alot of the songs are a bit on the corny side, which is why they get a 3 1/2 rating. This is guitar pop/rock with a huge influence of The Beatles. If you like the band Fastball, you will probably like this as well.
